{"fq5":"4","fq6":"1","fq7":"2","fq8":"1","fq9":"2","fq1":"For "shared neighbors" I would jump back-and-forth and try to spot the shared parts.

For "most common degree" I would pick several nodes that looked about-the same-degree, hover over it and count the highlighted edges.  If they were the same degree, it was usually already a majority. If it was not a majority, I would keep going until I found a majority. Sometimes I had to recount on the "most common degree" because I mis-counted the highlighted edges.   ","fq2":"I did not like the spherical projection.  I had to hunt for the focus nodes sometimes.  ","fq4":"Early on, I counted highlighted-neighbors BUT after two or three times, I realized that neighbors that were part of the group of focus nodes DID NOT change their appearance.  It was much harder to count edges than nodes, but it was the only way to be sure.  Not sure if that was deliberate or not...

I did not have any "reachable in k-hops" questions, even though that was in the definitions section."}
